import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>Welcome to KGP Bus Location Tracker</h1>
      <p>
        This application helps you track your location and share it with administrators.
      </p>
      <div style={{ marginTop: '20px' }}>
        <Link to="/login">
          <button style={{ marginRight: '10px' }}>Login</button>
        </Link>
        <Link to="/signup">
          <button>Register</button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
